        <div>
            <h4 style={{textAlign: 'center', color: 'lightseagreen'}}>Thank you for your order!</h4>
            <Button style={{textAlign: 'center'}} component={Link} to="/" variant="outlined">Back to Cart</Button>
        </div>
    )
}

